import { Pipe, PipeTransform } from '@angular/core';
import { ILanguage } from './../../api/metadata.d';

@Pipe({
  name: 'filterLanguages',
})
export class FilterLanguagesPipe implements PipeTransform {

  transform(value: ILanguage[], totalLanguages: ILanguage[]): ILanguage[] {
    let result: ILanguage[] = value;
    if (totalLanguages.length) {
      result = value.filter((dfLang) => totalLanguages.every((tlng) => dfLang.code !== tlng.code));
    }
    return result;
  }

}

import { Pipe, PipeTransform } from '@angular/core';
import { IProduct } from './../../api/catalog.d';

@Pipe({
  name: 'filterUsedProducts',
})
export class FilterUsedProductsPipe implements PipeTransform {

  transform(value: IProduct[], productId: string, alreadyUsedProducts: string[]): unknown {
    if (!value) {
      return [];
    }
    return value
      .filter(({ id }) => id === productId || !alreadyUsedProducts.some((produId) => produId === id && produId !== productId));

  }

}

