import { Injectable } from '@angular/core';
import { Router } from '@angular/router';
import * as auth0 from 'auth0-js';
import { BehaviorSubject, Observable } from 'rxjs';
import { share } from 'rxjs/operators';
import { environment } from 'src/environments/environment';
import { AuthUser } from './auth';
import { AuthConfigService } from './auth-config.service';

(window as any).global = window;
export const EXPIRES_AT_KEY = 'expiresAt';
export const TOKEN_KEY = 'accessToken';
export const TOKEN_ID = 'token';
export const USER_ID = 'user_id';

@Injectable()
export class AuthService {
  // Create Auth0 web auth instance
  private auth0: auth0.WebAuth;
  public get user(): AuthUser {
    return this.userProfile;
  }
  public get isAdmin(): boolean {
    return this.userProfile &&
      this.userProfile['https://hasura.io/jwt/claims'] &&
      this.userProfile['https://hasura.io/jwt/claims']['x-hasura-default-role'] === 'admin' ? true : false;
  }

  public get user$(): Observable<AuthUser> {
    return this.onUserLoginSubject.pipe(share());
  }

  public get token$(): Observable<string> {
    return this.onTokenChangeSubject.pipe(share());
  }

  // Store authentication data
  public accessToken: string;
  private expiresAt: number;
  private authenticated: boolean;
  private userProfile: any;
  private onUserLoginSubject = new BehaviorSubject<AuthUser>(null);
  private onTokenChangeSubject = new BehaviorSubject<string>(null);

  constructor(private router: Router, private config: AuthConfigService) {
    this.auth0 = new auth0.WebAuth(this.config);

    this.expiresAt = Number(localStorage.getItem(EXPIRES_AT_KEY));
    this.accessToken = localStorage.getItem(TOKEN_KEY);
    this.authenticated = this.expiresAt > 0;
    this.renewSession();
  }

  public authorize() {
    // Auth0 authorize request
    this.auth0.authorize();
  }

  public login(username: string, password: string): Observable<any> {
    return new Observable((subscriber) => {
      const realm = 'Username-Password-Authentication';
      this.auth0.login({ username, password, realm }, (err, ok) => {
        if (ok !== undefined) {
          subscriber.next(ok.Id);
          return subscriber.complete();
        }
        subscriber.error(err);
      });
    });
  }

  public singup(email: string, password: string): Observable<any> {
    return new Observable((subscriber) => {
      this.auth0.signup({
        connection: 'Username-Password-Authentication',
        email,
        password,
      }, (err, ok) => {
        if (ok !== undefined) {
          subscriber.next(ok.Id);
          return subscriber.complete();
        }
        subscriber.error(err);
      });
    });
  }
  public changePassword(email: string): Observable<any> {
    return new Observable((subscriber) => {
      this.auth0.changePassword({
        connection: 'Username-Password-Authentication',
        email,
      }, (err, ok) => {
        // tslint:disable-next-line:no-console
        console.log(err, ok);
        if (ok !== undefined) {
          subscriber.next(ok.Id);
          return subscriber.complete();
        }
        subscriber.error(err);
      });
    });
  }

  public handleLoginCallback() {
    // When Auth0 hash parsed, get profile
    this.auth0.parseHash((err, authResult) => {
      if (authResult && authResult.accessToken) {
        window.location.hash = '';
        this.getUserInfo(authResult, true);
      } else if (err) {
        // tslint:disable-next-line:no-console
        console.error(`Error: ${err.error}`);
      }
    });
  }

  private renewSession() {
    this.auth0.checkSession({}, (err, authResult) => {
      if (authResult) {
        this.getUserInfo(authResult, false);
      }
    });
  }

  private getUserInfo(authResult, redirect: boolean) {
    // Use access token to retrieve user's profile and set session
    this.auth0.client.userInfo(authResult.accessToken, (err, profile) => {
      if (profile) {
        this.setSession(authResult, profile);
        if (redirect) {
          this.router.navigate(['/']);
        }
      }
    });
  }

  private setSession(authResult, profile) {
    // Save authentication data and update login status subject
    this.expiresAt = authResult.expiresIn * 1000 + Date.now();
    localStorage.setItem(EXPIRES_AT_KEY, this.expiresAt.toString());
    localStorage.setItem(TOKEN_KEY, authResult.accessToken);
    localStorage.setItem(TOKEN_ID, authResult.idToken);
    localStorage.setItem(USER_ID, profile.sub);
    this.accessToken = authResult.accessToken;
    this.userProfile = profile;
    this.authenticated = true;
    this.onUserLoginSubject.next(profile);
    this.onTokenChangeSubject.next(authResult.idToken);
  }

  public logout() {
    localStorage.removeItem(EXPIRES_AT_KEY);
    localStorage.removeItem(TOKEN_KEY);
    localStorage.removeItem(TOKEN_ID);
    localStorage.removeItem(USER_ID);
    // Log out of Auth0 session
    // Ensure that returnTo URL is specified in Auth0
    // Application settings for Allowed Logout URLs
    this.auth0.logout({
      returnTo: environment.auth.returnTo,
      clientID: environment.auth.clientID,
    });
  }

  public get isLoggedIn(): boolean {
    // Check if current date is before token
    // expiration and user is signed in locally
    return Date.now() < this.expiresAt && this.authenticated;
  }
}

import { Injectable } from '@angular/core';
import { Apollo } from 'apollo-angular';
import { Observable } from 'rxjs';
import { map } from 'rxjs/operators';
import { ACCOUNT_ID_KEY } from '../constants';
import { IBusinesMeta, IBusiness } from './business';
import {
  BUSINESS_FULL_QUERY,
  BUSINESS_ID_QUERY,
  DELETE_BUSINESS,
  EDIT_BUSINESS,
  INSERT_BUSINESS,
  REMOVE_METADATA,
} from './business.queries';

@Injectable({
  providedIn: 'root',
})
export class BusinessService {

  constructor(private apollo: Apollo) { }

  public getAll(): Observable<IBusiness[]> {
    return this.apollo.watchQuery<{ business: IBusiness[] }>({
      query: BUSINESS_FULL_QUERY,
    }).valueChanges.pipe(map((response) => response.data.business));
  }
  public getById(id: string): Observable<IBusiness> {
    return this.apollo.subscribe<{ business_by_pk: IBusiness }>({
      query: BUSINESS_ID_QUERY,
      variables: { id },
    }).pipe(map((response) => response.data.business_by_pk));
  }
  public create(business: IBusiness): Observable<any> {
    delete business.address.id;
    const businnesGQL = {
      name: business.name,
      type: business.type,
      logotype: business.logotype,
      account_id: localStorage.getItem(ACCOUNT_ID_KEY),
      business_meta: { data: business.business_meta },
      default_lang: business.default_lang,
      languages: {
        data: business.languages,
      },
      address: {
        data: business.address,
      },
    };
    return this.apollo.mutate<any>({
      // query: BUSINESS_FULL_QUERY
      mutation: INSERT_BUSINESS,
      variables: {
        business: businnesGQL,
      },
      refetchQueries: [
        { query: BUSINESS_FULL_QUERY },
      ],
    }).pipe(map(({ data }) => data.insert_business_one));
  }

  public edit(business: IBusiness) {
    const languages = business.languages.map(({ language }) => ({ language, business_id: business.id }));
    return this.apollo.mutate<IBusiness>({
      mutation: EDIT_BUSINESS,
      variables: {
        id: business.id,
        name: business.name,
        type: business.type,
        logotype: business.logotype,
        default_lang: business.default_lang,
        languages,
      },
      refetchQueries: [
        { query: BUSINESS_FULL_QUERY },
        {
          query: BUSINESS_ID_QUERY,
          variables: { id: business.id },
        },
      ],
    });
  }

  public setMetadata(metadata: IBusinesMeta[], businessId: string) {

    metadata.forEach((m) => m.business_id = businessId);
    return this.apollo.mutate<any>({
      mutation: REMOVE_METADATA,
      variables: {
        metadata,
        businessId,
      },
    });
  }

  public remove(businessId: string) {
    return this.apollo.mutate<IBusiness>({
      mutation: DELETE_BUSINESS,
      variables: {
        id: businessId,
      },
      refetchQueries: [
        { query: BUSINESS_FULL_QUERY },
      ],
    });
  }
}

import { Injectable } from '@angular/core';
import { Apollo } from 'apollo-angular';
import { map, take } from 'rxjs/operators';
import { ICategory, IProduct, IProductHighlight } from './catalog';
import {
  GET_ALL_CATEGORIES,
  GET_ALL_PRODUCTS,
  GET_CATEGORY,
  GET_PRODUCT_BY_ID,
  GET_PRODUCTS_HIGHLIGHT,
  INSERT_CATEGORY,
  INSERT_FULL_CATEGORY,
  REMOVE_CATEGORY,
  SORT_CATEGORY,
  UPDATE_CATEGORY,
} from './catalog.queries';
import { GET_CATALOG, INSERT_PRODUCT, INSERT_PRODUCTS_HIGHLIGHT, REMOVE_PRODUCT, UPDATE_PRODUCT } from './catalog.queries';
import { InsertFullCatalog } from './utils';

@Injectable({
  providedIn: 'root',
})
export class CatalogService {

  constructor(private apollo: Apollo) { }

  public getCatalog(businessId: string) {
    return this.apollo.watchQuery<{ category: ICategory[] }>({
      query: GET_CATALOG,
      variables: {
        businessId,
      },
    }).valueChanges.pipe(map(({ data }) => data.category));
  }

  public getCategories(businessId: string) {
    return this.apollo.watchQuery<{ category: ICategory[] }>({
      query: GET_ALL_CATEGORIES,
      variables: {
        businessId,
      },
    }).valueChanges.pipe(map(({ data }) => data.category));
  }
  public getCategoryById(categoryId: string) {
    return this.apollo.watchQuery<{ category_by_pk: ICategory }>({
      query: GET_CATEGORY,
      variables: {
        categoryId,
      },
    }).valueChanges.pipe(map(({ data }) => data.category_by_pk));
  }

  public insertCategory(category: ICategory) {
    delete category.id;
    return this.apollo.mutate<ICategory>({
      mutation: INSERT_CATEGORY,
      variables: {
        category: {
          business_id: category.business_id,
          name: category.name,
          name_languages: { data: category.name_languages },
          parent_category: category.parent_category,
        },
      },
      refetchQueries: [
        {
          query: GET_ALL_CATEGORIES,
          variables: { businessId: category.business_id },
        },
        {
          query: GET_CATALOG,
          variables: {
            businessId: category.business_id,
          },
        },
      ],
    });
  }

  public insertFullCatalog(categories: InsertFullCatalog) {
    const businessId = categories[0].business_id;
    return this.apollo.mutate<ICategory>({
      mutation: INSERT_FULL_CATEGORY,
      variables: {
        categories,
      },
      refetchQueries: [
        {
          query: GET_ALL_CATEGORIES,
          variables: {
            businessId,
          },
        },
        {
          query: GET_CATALOG,
          variables: {
            businessId,
          },
        },
        {
          query: GET_ALL_PRODUCTS,
          variables: {
            businessId,
          },
        },
      ],
    });
  }

  public sortCategories(categories: ICategory[], businessId: string) {
    return this.apollo.mutate({
      mutation: SORT_CATEGORY,
      variables: {
        categories,
      },
      refetchQueries: [
        {
          query: GET_ALL_CATEGORIES,
          variables: { businessId },
        },
        {
          query: GET_CATALOG,
          variables: {
            businessId,
          },
        },
      ],
    }).pipe(take(1));
  }
  public editCategory(category: ICategory, businessId: string) {
    return this.apollo.mutate({
      mutation: UPDATE_CATEGORY,
      variables: {
        id: category.id,
        name: category.name,
        parent_category: category.parent_category,
        languages: category.name_languages.map((lang) => ({ ...lang, category_id: category.id })),
      },
      refetchQueries: [
        {
          query: GET_CATEGORY,
          variables: { categoryId: category.id },
        },
        {
          query: GET_ALL_CATEGORIES,
          variables: { businessId: category.business_id || businessId },
        },
        {
          query: GET_CATALOG,
          variables: {
            businessId,
          },
        },
      ],
    }).pipe(take(1));
  }

  public removeCategory(categoryId: string, businessId: string) {
    return this.apollo.mutate({
      mutation: REMOVE_CATEGORY,
      variables: {
        id: categoryId,
      },
      awaitRefetchQueries: true,
      refetchQueries: [
        {
          query: GET_ALL_CATEGORIES,
          variables: { businessId },
        },
        {
          query: GET_CATALOG,
          variables: {
            businessId,
          },
        },
      ],
    });
  }

  public getProducts(businessId: string) {
    return this.apollo.watchQuery<{ product: IProduct[] }>({
      query: GET_ALL_PRODUCTS,
      variables: {
        businessId,
      },
    }).valueChanges.pipe(map(({ data }) => data.product));
  }
  public getProductById(productId: string) {
    return this.apollo.watchQuery<{ product_by_pk: IProduct }>({
      query: GET_PRODUCT_BY_ID,
      variables: {
        id: productId,
      },
    }).valueChanges.pipe(map(({ data }) => data.product_by_pk));
  }

  public insertProduct(product: IProduct) {
    delete product.id;
    return this.apollo.mutate<IProduct>({
      mutation: INSERT_PRODUCT,
      variables: {
        product: {
          id: product.id,
          name: product.name,
          description: product.description,
          category_id: product.category_id,
          is_active: product.is_active,
          feature_image: product.feature_image,
          price: product.price,
          business_id: product.business_id,
          name_languages: { data: product.name_languages },
          description_languages: { data: product.description_languages },
        },
      },
      refetchQueries: [{
        query: GET_ALL_PRODUCTS,
        variables: {
          businessId: product.business_id,
        },
      },
      {
        query: GET_CATALOG,
        variables: {
          businessId: product.business_id,
        },
      }],
    });
  }
  public editProduct(product: IProduct) {
    return this.apollo.mutate<IProduct>({
      mutation: UPDATE_PRODUCT,
      variables: {
        id: product.id,
        category_id: product.category_id,
        description: product.description,
        is_active: product.is_active,
        name: product.name,
        feature_image: product.feature_image,
        price: product.price,
        name_languages: product.name_languages.map((lang) => ({ ...lang, product_id: product.id })),
        description_languages: product.description_languages.map((lang) => ({ ...lang, product_id: product.id })),
      },
      refetchQueries: [
        {
          query: GET_ALL_PRODUCTS,
          variables: {
            businessId: product.business_id,
          },
        },
        {
          query: GET_PRODUCT_BY_ID,
          variables: {
            id: product.id,
          },
        },
        {
          query: GET_CATALOG,
          variables: {
            businessId: product.business_id,
          },
        }],
    });
  }

  public removeProduct(productId: string, businessId: string) {
    return this.apollo.mutate<IProduct>({
      mutation: REMOVE_PRODUCT,
      variables: {
        id: productId,
      },
      refetchQueries: [
        {
          query: GET_ALL_PRODUCTS,
          variables: {
            businessId,
          },
        },
        {
          query: GET_CATALOG,
          variables: {
            businessId,
          },
        }],
    });
  }

  public getHightlightProducts(businessId: string) {
    return this.apollo.watchQuery<{ product_highlight: IProductHighlight[] }>({
      query: GET_PRODUCTS_HIGHLIGHT,
      variables: {
        businessId,
      },
    }).valueChanges.pipe(map(({ data }) => data.product_highlight));
  }
  public addHighlightProducts(productsIds: string[], businessId: string) {
    return this.apollo.mutate<IProduct>({
      mutation: INSERT_PRODUCTS_HIGHLIGHT,
      variables: {
        businessId,
        productsHighlighted: productsIds.map((product_id) => ({ product_id, business_id: businessId })),
      },
      refetchQueries: [{
        query: GET_PRODUCTS_HIGHLIGHT,
        variables: {
          businessId,
        },
      }],
    });
  }
}

